import React from 'react';
import FileUploader from './components/FileUploader';
import { AppProvider } from './context/AppContext';

function App() {
  return (
    <AppProvider>
      <div className="App">
        <FileUploader />
      </div>
    </AppProvider>
  );
}

export default App;
